import styled from "styled-components";

export const WorksCardStyled = styled.li`
list-style-type: none;
margin-top: 56px;
`

export const WorksCardNumber = styled.h3`
font-family: Fraunces;
text-align: center;
font-size: 72px;
line-height: 1;
font-weight: 900;
color: #FDD6BA;
`

export const WorksCardHeader = styled.h4`
font-family: Fraunces;
text-align: center;
font-size: 28px;
line-height: 1.14;
font-weight: 900;
color: #333D4B;

margin-top: 24px;
`

export const WorksCardText = styled.p`
font-family: Barlow;
text-align: center;
font-size: 15px;
line-height: 1.14;
font-weight: 900;
color: #333D4B;
`
